// import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css'
import {BrowserRouter as Router,Route,Routes,Navigate} from 'react-router-dom'

import Employees from './employee/pages/Employee';
import Departments from './department/pages/Department';


function App() {
  return (

    <Router>
      <Routes>
        <Route path="/" element={<Departments/>}></Route>
        <Route path="*" element={<Navigate to="/"/>}></Route>
        <Route path="/employee/new" element={<Employees/>}></Route>
        <Route path="/:departmentId/employees" element={<DepartmentEmployee/>}></Route>
      </Routes>
    </Router>

  );
}

export default App;
